import React from "react";

function ListItem(props) {
  return (
    <React.Fragment>
      <p>Name = {props.name}</p>
      <p>{props.city}</p>
      <p>{props.email}</p>
      <p>{props.birthday}</p>
    </React.Fragment>
  );
}

export default ListItem;
